// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BookChainNova {
    struct User {
        address userAddress;
        string name;
        bool isRegistered;
        string role; // e.g., "reader", "admin"
    }

    struct Book {
        string title;
        string author;
        string genre;
        string imageUrl;
        string purchaseLink;
        uint256 price;
        bool exists;
    }

    mapping(address => User) public users;
    mapping(uint256 => Book) public books;
    uint256 public bookCount;

    event UserRegistered(address indexed userAddress, string name, string role);
    event BookAdded(uint256 indexed bookId, string title, string author);

    // Register a new user
    function registerUser(string memory _name, string memory _role) public {
        require(!users[msg.sender].isRegistered, "User already registered");

        users[msg.sender] = User(msg.sender, _name, true, _role);
        emit UserRegistered(msg.sender, _name, _role);
    }

    // Add a new book
    function addBook(
        string memory _title,
        string memory _author,
        string memory _genre,
        string memory _imageUrl,
        string memory _purchaseLink,
        uint256 _price
    ) public {
        require(users[msg.sender].isRegistered, "Only registered users can add books");

        bookCount++;
        books[bookCount] = Book(_title, _author, _genre, _imageUrl, _purchaseLink, _price, true);
        emit BookAdded(bookCount, _title, _author);
    }

    // Get book details
    function getBook(uint256 _bookId) public view returns (Book memory) {
        require(books[_bookId].exists, "Book does not exist");
        return books[_bookId];
    }

    // Get user details
    function getUser(address _userAddress) public view returns (User memory) {
        return users[_userAddress];
    }
}

